class Solution:
    def maxOperations(self, s: str) -> int:

        m = 0 # multiplication factor
        ans = one_count = 0
        cur = '1'
        for i in range(len(s)-1,-1,-1):
            c = s[i]
            if c == '1':
                one_count += 1
            elif cur == '1':
                ans += one_count*m
                one_count = 0
                cur = '0'
                m += 1
            cur = c

        return ans + one_count*m
